  false,\n\t\"url\": null,\n\t\"notes\": \"The focus of this yearu2019s waterbird
  production monitoring was on the five species of waterfowl nesting on the refuge.
  They are Canada goose, wood duck, mallard, black duck and hooded merganser. After
  two years of drought (1998 and 1999), the refuge has enjoyed two years of high water
  levels at the beginning of the nesting season and all through the brood rearing
  period.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
